import React from "react";
import { Outlet } from "react-router-dom";
import NavBar from "./NavBar";

const Home=()=>{
    return(
        <>
            <NavBar/>
        <div style={{backgroundColor:"royalblue", width:"100%",height:"100vh"}}>
           <h1>This is Home page</h1>
        </div>
        <Outlet/>
        </>
    );
}
export default Home;
